import React from 'react';
import { motion } from 'framer-motion';

const FadeIn = ({ children, delay = 0 }) => (
  <motion.div initial={{ opacity: 0, y: 12 }} animate={{ opacity: 1, y: 0 }} transition={{ duration: 0.6, delay }}>
    {children}
  </motion.div>
);

export default function YakushkinPortfolio() {
  return (
    <div style={{
      minHeight: '100vh',
      backgroundImage: 'linear-gradient(135deg, #fdf6e3, #f0f9ff, #e6f7f1)',
      backgroundRepeat: 'no-repeat',
      backgroundSize: 'cover',
      color: '#1e293b',
      display: 'flex',
      flexDirection: 'column'
    }}>
      <section style={{ flexGrow: 1, display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center' }}>
        <h1>Якушкин Д.О.</h1>
        <p>Индивидуальный предприниматель в строительстве. Команда опытных мастеров.</p>
      </section>
    </div>
  );
}
